    render() {
        return (
            <div>
            <div className="flip-card-one" id="card1">
            <div className="flip-card-inner">
                <div className="flip-card-front flav">

                </div>
                <div className="flip-card-back">
                    <h2> Dreamers <br/> Elixir </h2>
                    <p className="card-txt"> The best green tea juice drink on the market. 
                    100 % natural and some of the most creative flavours you have ever seen!
                    </p>

                </div>
            </div>
        </div>
</div>
        )
    }
};
